import React from "react";

export const Home = () => {
  return (
    <div>
      <div className="desc">
        <h1>Selamat Datang di web cat gallery!</h1>
        <p>Disini menyediakan berbagai jenis foto kucing </p>
      </div>
    </div>
  );
};

export default Home;
